import React, { Fragment} from "react";

import {
    CssClasses,
    addColorTypeToCssClass,
} 
from "../../utilities";

import * as Titles from "../../utilities/bootstrapTitles";

export const H1 = props => {
    const classes = new CssClasses();

    addColorTypeToCssClass({
        type: "text",
        classes: classes,
        props: props
    });
    

    return (
        <Titles.H1 className={classes.toString()}>
            a
        </Titles.H1>
    );
}
